function general_fetch(t,e,o="GET",r=void 0){fetch(t,{method:o,headers:{"Content-Type":"application/json"},body:r}).then(t=>{if(204===t.status)return t.text();if(t.ok)return t.json();throw document.getElementById("error").show(),new Error("HTTP error! status: "+t.status)}).then(e).catch(t=>{void 0!==t&&console.error(t)})}